                    "<p>\r\n  Hey eruckemmanuel!\r\n</p>\r\n\r\n<p>\r\n\r\n<p>\r\n  We're reaching out to let you know that as <a href=\"https://github.blog/2022-05-04-software-security-starts-with-the-developer-securing-developer-accounts-with-2fa/\">announced last year</a>,\r\n  we will <a href=\"https://github.blog/2023-03-09-raising-the-bar-for-software-security-github-2fa-begins-march-13\">officially begin</a> requiring two-factor authentication (2FA) for certain contributors on GitHub.com.\r\n You are receiving this notification because your account meets the criteria for the current enrollment group - but you have 2FA enabled already! \r\n</p>\r\n\r\n<p>\r\n  <b>You don't need to do anything</b> in response to this email, <b>but please do not disable 2FA</b> between now and September 21st, 2023 at 00:00 (UTC).\r\n  If you disable 2FA, your access to GitHub.com at the end of the 45 day enrollment period will be restricted until you re-enable 2FA.\r\n  This email, and a dismissable banner in the GitHub.com UI, will be the only notifications about this change.\r\n</p>\r\n\r\n<p>\r\n  Making the software supply chain more secure is a team effort, and we couldn't do it without you. Your enrollment in 2FA is an impactful step in keeping the world's software secure.\r\n</p>\r\n\r\n\r\n<h2>What to know about the required 2FA initiative</h2>\r\n\r\n<p>\r\n  We are enrolling GitHub users who manage or author code on GitHub.\r\n  You are one of those people!\r\n  More information about our plan to increase 2FA adoption can be found in <a href=\"https://github.blog/2023-03-09-raising-the-bar-for-software-security-github-2fa-begins-march-13\">this blog post.</a>\r\nThis is a GitHub.com program, and unrelated to your organization or enterprise membership. \r\n</p>\r\n\r\n<h3>I already have 2FA enabled, do I need to do anything?</h3>\r\n\r\n<p>\r\n  No, you don't need to take any additional actions.\r\n  After September 21st, 2023 at 00:00 (UTC), you will no longer be able to disable 2FA for your account, but you will still be able to update your 2FA methods and settings.\r\n</p>\r\n\r\n<p>\r\n  Critically, if you disable 2FA between now and September 21st, 2023 at 00:00 (UTC), your access to GitHub.com will be restricted after the deadline if you don't re-enable 2FA.\r\n</p>\r\n\r\n<h3>What forms of 2FA can I use?</h3>\r\n\r\n<p>\r\n  We want you to have the most seamless experience with 2FA possible, so you can choose one or more of the following options:\r\n</p>\r\n\r\n<ul>\r\n  <li>Security key</li>\r\n  <li>GitHub Mobile</li>\r\n  <li>Authenticator application (TOTP)</li>\r\n  <li>Text messages (SMS)</li>\r\n</ul>\r\n\r\n<p>\r\n  You should set up at least two of these options, to ensure you always have access to your account.\r\n  Head to <a href=\"https://github.com/settings/security\">https://github.com/settings/security</a> to enroll more 2FA methods.\r\n</p>\r\n\r\n<h3>What happens to my PATs and SSH keys at the deadline?</h3>\r\n\r\n<p>\r\n  Your PATs, SSH keys, and applications will all keep working after the deadline, regardless of your 2FA enrollment.\r\n  PATs in particular are used extensively in important automation, and interruption there can cause outages in critical systems.\r\n</p>\r\n\r\n<h3>What do I do if I lose my 2FA device?</h3>\r\n\r\n<p>\r\n  GitHub strongly encourages the use of multiple second factor options.\r\n  If you lose all of your second factors, recovery codes are the only way to access your account again.\r\n  By saving your recovery codes, you'll be able to regain access.\r\n</p>\r\n\r\n<p>\r\n  Be sure to enable cloud backup for your authenticator app and save your recovery codes.\r\n  Many phones and computers can be security keys as well - registering them with GitHub.com gives you additional, highly-secure 2FA methods.\r\n</p>\r\n\r\n<p>\r\n  For security reasons, GitHub Support may not be able to restore access to accounts with 2FA enabled if you lose your 2FA credentials and lose access to your account recovery methods.\r\n</p>\r\n\r\n<p>\r\n  More information about recovery codes can be found on GitHub Help at <a href=\"https://docs.github.com/articles/recovering-your-account-if-you-lose-your-2fa-credentials\">https://docs.github.com/articles/recovering-your-account-if-you-lose-your-2fa-credentials</a>\r\n</p>\r\n\r\n<h3>Why is GitHub requiring 2FA?</h3>\r\n\r\n<p>\r\n  Ensuring account security is a shared responsibility GitHub takes seriously.\r\n  Strong authentication and the use of 2FA have been recognized as best practice for many years.\r\n  We feel that GitHub has a duty to lead this push toward strong authentication as part of protecting the software supply chain.\r\n</p>\r\n\r\n\r\n\r\n<p>\r\n  To see this and other security events for your account, visit <a href=\"https://github.com/settings/security-log\">your account security audit log.</a>\r\n</p>\r\n\r\n<p>\r\n  If you run into problems, please contact support by visiting <a href=\"https://github.com/contact\">the GitHub support page.</a>\r\n</p>\r\n\r\n<p>\r\nThanks,<br>\r\nThe GitHub Team\r\n</p>\r\n"
