                    "<div dir=\"ltr\"><img src=\"cid:ii_lm2akefl0\" alt=\"logo_transparent.png\" width=\"495\" height=\"562\"><br></div><br><div class=\"gmail_quote\"><div dir=\"ltr\" class=\"gmail_attr\">On Sat, 2 Sept 2023 at 18:20, Eruck Emmanuel &lt;<a href=\"mailto:eruck@vehseh.com\">eruck@vehseh.com</a>&gt; wrote:<br></div><blockquote class=\"gmail_quote\" style=\"margin:0px 0px 0px 0.8ex;border-left:1px solid rgb(204,204,204);padding-left:1ex\"><div dir=\"auto\">You are always welcomed </div><div><br><div class=\"gmail_quote\"><div dir=\"ltr\" class=\"gmail_attr\">On Sat, Sep 2, 2023 at 6:19 PM Eruck Emmanuel &lt;<a href=\"mailto:eruckemmanuel2@gmail.com\" target=\"_blank\">eruckemmanuel2@gmail.com</a>&gt; wrote:<br></div><blockquote class=\"gmail_quote\" style=\"margin:0px 0px 0px 0.8ex;border-left:1px solid rgb(204,204,204);padding-left:1ex\"><div dir=\"ltr\">The pleasure was mine</div><br><div><div dir=\"ltr\">On Sat, 2 Sept 2023 at 18:18, Eruck Emmanuel &lt;<a href=\"mailto:eruck.emma@gmail.com\" target=\"_blank\">eruck.emma@gmail.com</a>&gt; wrote:<br></div><blockquote style=\"margin:0px 0px 0px 0.8ex;border-left:1px solid rgb(204,204,204);padding-left:1ex\"><div>It was my pleasure!</div><div><br><div><div dir=\"ltr\">On Sat, Sep 2, 2023 at 6:17 PM Eruck Emmanuel &lt;<a href=\"mailto:eruckemmanuel2@gmail.com\" target=\"_blank\">eruckemmanuel2@gmail.com</a>&gt; wrote:<br></div><blockquote style=\"margin:0px 0px 0px 0.8ex;border-left:1px solid rgb(204,204,204);padding-left:1ex\"><div dir=\"ltr\">Hello Eruck<div><br></div><div>I would like to take this opportunity to thank you for what you did for me during the presentation with the Minister yesterday.</div><div><br></div><div>It was a game changing experience.</div></div><div dir=\"ltr\"><div><br clear=\"all\"><div><br></div>-- <br><div dir=\"ltr\"><div dir=\"ltr\"><div><div dir=\"ltr\"><span style=\"color:rgb(61,133,198)\"><i><span style=\"background-color:rgb(111,168,220)\"><font size=\"2\" style=\"color:rgb(61,133,198)\"><b>Emmanuel ERUCK</b></font></span></i></span><br></div><div><span style=\"color:rgb(61,133,198)\"><i><span style=\"background-color:rgb(111,168,220)\"><font size=\"2\" style=\"color:rgb(61,133,198)\"><b>@VEhSEh</b></font></span></i></span></div></div></div></div></div></div>\r\n</blockquote></div></div>\r\n</blockquote></div><br clear=\"all\"><div><br></div>-- <br><div dir=\"ltr\"><div dir=\"ltr\"><div><div dir=\"ltr\"><span style=\"color:rgb(61,133,198)\"><i><span style=\"background-color:rgb(111,168,220)\"><font size=\"2\" style=\"color:rgb(61,133,198)\"><b>Emmanuel ERUCK</b></font></span></i></span><br></div><div><span style=\"color:rgb(61,133,198)\"><i><span style=\"background-color:rgb(111,168,220)\"><font size=\"2\" style=\"color:rgb(61,133,198)\"><b>@VEhSEh</b></font></span></i></span></div></div></div></div></blockquote></div></div></blockquote></div><br clear=\"all\"><div><br></div><span class=\"gmail_signature_prefix\">-- </span><br><div dir=\"ltr\" class=\"gmail_signature\"><div dir=\"ltr\"><div><div dir=\"ltr\"><span style=\"color:rgb(61,133,198)\"><i><span style=\"background-color:rgb(111,168,220)\"><font size=\"2\"><b>Emmanuel ERUCK</b></font></span></i></span><br></div><div><span style=\"color:rgb(61,133,198)\"><i><span style=\"background-color:rgb(111,168,220)\"><font size=\"2\"><b>@VEhSEh</b></font></span></i></span></div></div></div></div>\r\n"
